    false,nt"url": null,nt"notes": "North Dakota is one of the last strongholds
    for the Federally threatened piping plover (Charadrius melodus). Protecting and
    enhancing plover habitat in North Dakota will play an important role in recovery
    of the species (Piping Plover Recovery Team, unpublished report 1996). WPA's used
    by breeding piping plovers in North Dakota are typically small disjunct pieces of
    property ranging in size from 16 to 400 hectares and are usually surrounded by cropland.
    Because of their small size and the close proximity of agricultural land to their
    boundaries, wetland habitats on WPA's are vulnerable to pesticides used on adjacent
    cropland (Grue et al. 1988). This On-Refuge investigation delineates habitat for
    threatened and endangered species on U.S. Fish and Wildlife Service lands, identifies
    pesticide pathways to those habitats, and assists private and public landowners
    in their efforts to protect these areas from harm caused by pesticides. Also, this
    project provides a spatial data base of land use and endangered species habitat
    coverages, which is updated on a continual basis as some of these species pioneer
    into new habitats. The results of this investigation provide a readily usable, up-to-date
    data base to assist land managers with management decisions.",nt"owner_org":
